const [nextPrayer, setNextPrayer] = React.useState(null);
const [countdown, setCountdown] = React.useState('');

React.useEffect(() => {
  const fetchPrayerTimes = async () => {
    try {
      const response = await fetch('https://api.aladhan.com/v1/timingsByCity?city=Jeddah&country=Saudi%20Arabia&method=4');
      const data = await response.json();
      const timings = data.data.timings;

      const prayers = [
        { name: 'الفجر', time: timings.Fajr },
        { name: 'الظهر', time: timings.Dhuhr },
        { name: 'العصر', time: timings.Asr },
        { name: 'المغرب', time: timings.Maghrib },
        { name: 'العشاء', time: timings.Isha }
      ];

      const now = new Date();
      const currentTime = now.getHours() * 60 + now.getMinutes();

      for (let prayer of prayers) {
        const [hours, minutes] = prayer.time.split(':').map(Number);
        const prayerTime = hours * 60 + minutes;

        if (prayerTime > currentTime) {
          setNextPrayer({ ...prayer, timeInMinutes: prayerTime });
          return;
        }
      }

      const [hours, minutes] = prayers[0].time.split(':').map(Number);
      setNextPrayer({ ...prayers[0], timeInMinutes: hours * 60 + minutes, tomorrow: true });
    } catch (error) {
      console.error('Error fetching prayer times:', error);
    }
  };

  fetchPrayerTimes();
  const interval = setInterval(fetchPrayerTimes, 60000);
  return () => clearInterval(interval);
}, []);

React.useEffect(() => {
  if (!nextPrayer) return;

  const updateCountdown = () => {
    const now = new Date();
    const currentTime = now.getHours() * 60 + now.getMinutes();
    let diff = nextPrayer.timeInMinutes - currentTime;

    if (nextPrayer.tomorrow || diff < 0) {
      diff = (24 * 60) - currentTime + nextPrayer.timeInMinutes;
    }

    const hours = Math.floor(diff / 60);
    const minutes = diff % 60;
    setCountdown(`${hours}h ${minutes}m`);
  };

  updateCountdown();
  const interval = setInterval(updateCountdown, 60000);
  return () => clearInterval(interval);
}, [nextPrayer]);

