  props.setCustomData({ ...config, ...newSettings });
};

const fetchVMs = async () => {
  if (!config.url || !config.token || !config.node) {
    setLoading(false);
    return;
  }

  // Save scroll position before fetching
  const scrollPos = scrollContainerRef.current?.scrollTop || 0;

  try {
    const apiUrl = `${config.url}/api2/json/nodes/${config.node}/qemu`;
    const response = await proxyFetch(apiUrl, {
      method: 'GET',
      headers: {
        'Authorization': `PVEAPIToken=${config.token}`
      }
    });

    if (!response.ok) {
      throw new Error(`HTTP ${response.status}: ${response.statusText}`);
    }

    const data = await response.json();
    setVms(data.data);
    setError('');

    // Restore scroll position after state update
    setTimeout(() => {
      if (scrollContainerRef.current) {
        scrollContainerRef.current.scrollTop = scrollPos;
      }
    }, 0);
  } catch (err) {
    setError(err.message);
  } finally {
    setLoading(false);
  }
};

const executeAction = async (vmid, action) => {
  setActionLoading(`${vmid}-${action}`);
  setError('');

  try {
    const apiUrl = `${config.url}/api2/json/nodes/${config.node}/qemu/${vmid}/status/${action}`;

    const response = await proxyFetch(apiUrl, {
      method: 'POST',
      headers: {
        'Authorization': `PVEAPIToken=${config.token}`,
        'Content-Type': 'application/x-www-form-urlencoded'
      },
      body: ''
    });

    const result = await response.json();

    if (!response.ok) {
      throw new Error(result.errors || `HTTP ${response.status}`);
    }

    setTimeout(fetchVMs, 2000);

  } catch (err) {
    setError(`Action failed: ${err.message}`);
  } finally {
    setActionLoading(null);
  }
};

