React.useEffect(() => {
    const fetchData = async () => {
        if (!config.url || !config.apiKey) return;
        try {
            const baseUrl = config.url.endsWith('/') ? config.url : config.url + '/';
            const apiUrl = baseUrl + 'api/v1';

            // Fetch processing requests directly
            const reqResp = await proxyFetch(`${apiUrl}/request?filter=processing`, {
                headers: { 'X-Api-Key': config.apiKey }
            });
            const reqData = await reqResp.json();

            const now = Date.now();
            const stuck = [];
            for (const req of reqData.results) {
                const createdAt = new Date(req.createdAt).getTime();
                if (minProcessingMs === 0 || (now - createdAt) > minProcessingMs) {
                    stuck.push({
                        id: req.id,
                        mediaId: req.media.id,
                        type: req.mediaType,
                        tmdbId: req.media.tmdbId,
                        createdAt: req.createdAt
                    });
                }
            }

            setStuckRequests(stuck);

            // Fetch titles if not cached
            for (const item of stuck) {
                if (!titles.has(item.mediaId)) {
                    try {
                        const mediaResp = await proxyFetch(`${apiUrl}/${item.type === 'tv' ? 'tv' : 'movie'}/${item.tmdbId}`, {
                            headers: { 'X-Api-Key': config.apiKey }
                        });
                        const mediaInfo = await mediaResp.json();
                        setTitles(prev => new Map(prev).set(item.mediaId, {
                            title: mediaInfo.title || mediaInfo.name,
                            poster: mediaInfo.posterPath ? `https://image.tmdb.org/t/p/w200${mediaInfo.posterPath}` : null
                        }));
                    } catch (err) {
                        console.error(`Error fetching ${item.type} ${item.tmdbId}:`, err);
                        setTitles(prev => new Map(prev).set(item.mediaId, {
                            title: `Error loading ${item.type} ${item.tmdbId}`,
                            poster: null
                        }));
                    }
                }
            }

            setLoading(false);
        } catch (err) {
            setError(`Failed to fetch data: ${err.message}`);
            setLoading(false);
        }
    };

    fetchData();
    const interval = setInterval(fetchData, intervalMs);
    return () => clearInterval(interval);
}, [config]);

