const formatUrl = (url) => {
  let target = url.trim();
  if (!target.startsWith('http://') && !target.startsWith('https://')) {
    return 'https://' + target;
  }
  return target;
};

const getDisplayName = (site) => {
  if (site.name) return site.name;
  return site.url.replace(/^https?:\/\/(www\.)?/, '').split('/')[0];
};

// 4. Check Function (Uses proxyFetch to avoid CORS)
const checkAllSites = async () => {
  if (sites.length === 0) return;

  setIsChecking(true);

  // Clone current statuses to update incrementally or wait for all
  // Here we wait for all to avoid flickering, but independent updates are also fine.
  // We'll do parallel checks.
  const newStatuses = { ...statuses };

  await Promise.all(sites.map(async (site) => {
    try {
      const controller = new AbortController();
      const timeoutId = setTimeout(() => controller.abort(), 8000); // 8s timeout

      const response = await proxyFetch(site.url, {
        method: 'GET',
        signal: controller.signal
      });
      clearTimeout(timeoutId);

      newStatuses[site.id] = response.ok ? 'online' : 'offline';
    } catch (err) {
      console.error("Check failed for", site.url, err);
      newStatuses[site.id] = 'offline';
    }
  }));

  setStatuses(newStatuses);
  setIsChecking(false);
};

