    }

    const cookie = loginResponse.headers.get('set-cookie');

    // Fetch torrent list
    const torrentsUrl = `${config.url}/api/v2/torrents/info`;
    const torrentsResponse = await proxyFetch(torrentsUrl, {
      headers: cookie ? { 'Cookie': cookie } : {}
